import {
  GET_CONTACT,
  GET_ALL_CONTACT,
  REMOVE_CONTACT,
  SET_CONTACT,
  SET_CONTACT_ERROR
} from './type';
import axios from 'axios';
export const setContact = (Name, Phone, Title) => async dispatch => {
  try {
    console.log('ACTION');
    const contact = { Name, Phone, Title };
    console.log(contact);

    const config = {
      headers: {
        'Content-Type': 'application/json'
      }
    };

    const body = JSON.stringify(contact);
    console.log('BODY');
    console.log(body);

    const res = await axios.post('/api/contacts', body, config);
    dispatch({
      type: SET_CONTACT,
      payload: res.data
    });
  } catch (error) {
    dispatch({
      type: SET_CONTACT_ERROR,
      payload: error
    });
  }
};
